import {useState} from 'react';
import "./twoDElement.css";

function TwoDElement() {
  const [styles, setStyles] = useState({});
  const [wrapperStyles, setWrapperStyles] = useState({});

  console.log("styles",styles);
  console.log('wrapperStyles', wrapperStyles)
  return (
    <div style={wrapperStyles} className="dynamic2DNumber-wrapper"
    onMouseOver={(event) => {
        const dx = event.clientX;
        // setStyles({...styles, fontSize:"100px"})
        setWrapperStyles({...wrapperStyles, height:"100px", width:"100px"})
    }} 
    onMouseOut={() => setWrapperStyles({})}
    >
      <span
        className="dynamic2DNumber"
        style={styles}
      >
        12
      </span>
    </div>
  );
}

export default TwoDElement;
